import React from "react";

export default function Photos(props) {
  if (props.photos) {
    return (
     <section className="Photos">
         <div className="row">
        {props.photos.map(function (photo, index) {
          return (
          <div className="col-3">
            <img src={photo.src.tiny} key={index} alt=""/>;
          </div>
          ) 
          })}
          </div>
        </section>
    );
} else {
    return null;
}
}
